asociada|Las siguientes cuentas están asociadas}} con esta dirección de correo electrónico:\n\n$2\n\n{{PLURAL:$3|Esta contraseña temporal|Estas contraseñas temporales}} expirarán en {{PLURAL:$5|un día|$5 días}}.\nDeberías iniciar sesión y establecer una contraseña nueva ahora. Si alguien más hizo este pedido,\no recuerdas tu contraseña original, y no deseas cambiarla, puedes\nignorar este mensaje y continuar usando tu contraseña anterior.\";'),('es','messages:passwordreset-emailelement','s:46:\"Nombre de usuario: $1\nContraseña temporal: $2\";'),('es','messages:passwordreset-emailsent','s:80:\"Se ha enviado un correo electrónico para el restablecimiento de tu contraseña.\";'),('es','messages:passwordreset-emailsent-capture','s:103:\"Se ha enviado un correo para el restablecimiento de la contraseña, el cual se muestra a continuación.\";'),('es','messages:passwordreset-emailerror-capture','s:165:\"Se generó un correo electrónico de restablecimiento de contraseña, que se muestra a continuación, pero el envío {{GENDER:$2|al usuario|a la usuaria}} falló: $1\";'),('es','messages:changeemail','s:44:\"Cambiar la dirección de correo electrónico\";'),('es','messages:changeemail-header','s:44:\"Cambiar la dirección de correo de la cuenta\";'),('es','messages:changeemail-text','s:134:\"Rellena este formulario para cambiar tu dirección de correo electrónico. Debes introducir la contraseña para confirmar este cambio.\";'),('es','messages:changeemail-no-info','s:63:\"Debes iniciar sesión para acceder directamente a esta página.\";'),('es','messages:changeemail-oldemail','s:31:\"Dirección electrónica actual:\";'),('es','messages:changeemail-newemail','s:30:\"Dirección electrónica nueva:\";'),('es','messages:changeemail-none','s:9:\"(ninguna)\";'),('es','messages:changeemail-password','s:31:\"Tu contraseña en {{SITENAME}}:\";'),('es','messages:changeemail-submit','s:27:\"Cambiar correo electrónico\";'),('es','messages:changeemail-cancel','s:8:\"Cancelar\";'),('es','messages:changeem