ge-legend','s:17:\"Renombrar página\";'),('es','messages:movepagetext','s:924:\"Mediante el siguiente formulario puedes renombrar una página, moviendo todo su historial al nombre nuevo.\nEl título anterior redirigirá al nuevo.\nPuedes actualizar automáticamente las redirecciones que apuntan al título original.\nSi eliges no hacerlo, asegúrate de revisar posibles redirecciones [[Special:DoubleRedirects|dobles]] o [[Special:BrokenRedirects|rotas]].\nTú eres responsable de asegurar que los enlaces continúen funcionando correctamente.\n\nNota que la página \'\'\'no\'\'\' se moverá si ya hay una página con el título nuevo, a menos de que ésta sea una redirección y no tenga historial de ediciones pasadas.\nEsto significa que puedes deshacer el renombrado en caso de un error, y que no puedes sobreescribir una página existente.\n\n\'\'\'Aviso\'\'\'\nEsto puede representar un cambio drástico e inesperado para una página popular;\nasegúrate de entender las consecuencias de esta acción antes de proceder.\";'),('es','messages:movepagetext-noredirectfixer','s:896:\"Usando el siguiente formulario se renombrará una página, trasladando todo su historial al nuevo nombre.\nEl título anterior se convertirá en una redirección al nuevo título.\nAsegúrate de no dejar [[Special:DoubleRedirects|redirecciones dobles]] o [[Special:BrokenRedirects|rotas]].\nTú eres responsable de hacer que los enlaces sigan apuntando adonde se supone que deberían hacerlo.\n\nRecuerda que la página \'\'\'no\'\'\' será renombrada si ya existe una página con el nuevo título, a no ser que sea una página vacía o una redirección sin historial.\nEsto significa que podrás renombrar una página a su título original si has cometido un error, pero que no podrás sobrescribir una página existente.\n\n\'\'\'¡Aviso!\'\'\'\nEste puede ser un cambio drástico e inesperado para una página popular;\npor favor, asegúrate de entender las consecuencias del procedimiento antes de seguir adelante.\";'),('es','messages:movepagetalktext','s:400:\"La página de discusión asociada, si existe, será renombrada automáticamente \'\'\'a menos que:\'\'\'\n*Estés trasladando la página entre espacios de nombres diferentes,\n*Una página de discusión no vacía ya exista con el nombre nuevo, o\n*No marques el recuadro «Renombrar la página de discusión asociada».\n\nEn estos casos, deberás trasladar manualmente el contenido de la página de discusión.\";'),('es','messages:movearticle','s:17:\"Renombrar página\";'),('es','messages:moveuserpage-warning','s:154:\"\'\'\'Aviso:\'\'\' estás a punto de trasladar una página de usuario. Ten en cuenta que solo será trasladada la página; el usuario \'\'\'no\'\'\' será renombrado.\";'),('es','messages:movecategorypage-warning','s:222:\"<strong>Advertencia:</strong> Estás a punto de trasladar una página de categoría. Ten en cuenta que se trasladará sólo la página y las páginas en la antigua categoría <em>no</em> serán recategorizadas en la nueva.\";'),('es','messages:movenologintext','s:110:\"Es necesario ser usuario registrado y [[Special:UserLogin|haber iniciado sesión]] para renombrar una página.\";'),('es','messages:movenotallowed','s:42:\"No tienes permiso para trasladar páginas.\";'),('es','messages:movenotallowedfile','s:42:\"No tienes permiso para trasladar archivos.\";'),('es','messages:cant-move-user-page','s:75:\"No tienes permiso para trasladar páginas de usuario (excepto subpáginas).\";'),('es','messages:cant-move-to-user-page','s:105:\"No tienes permiso para trasladar una página a una página de usuario (excepto a subpáginas de usuario).\";'),('es','messages:cant-move-category-page','s:56:\"No tienes permiso para trasladar páginas de categoría.\";'),('es','messages:cant-move-to-category-page','s:73:\"No tienes permiso para trasladar una página a una página de categoría.\";'),('es','messages:newtitle','s:16:\"A título nuevo:\";'),('es','messages:move-watch','s:36:\"Vigilar páginas de origen y destino\";'),('es','messages:movepagebtn','s:17:\"Renombrar página\";'),(