onfirmemail_pending','s:188:\"Ya se te ha enviado un código de confirmación; si creaste una cuenta recientemente, puede que tengas que esperar unos minutos para que te llegue antes de intentar pedir un nuevo código.\";'),('es','messages:confirmemail_send','s:35:\"Envíar el código de confimación.\";'),('es','messages:confirmemail_sent','s:32:\"Confirmación de correo enviada.\";'),('es','messages:confirmemail_oncreate','s:243:\"Se ha enviado un código de confirmación a tu dirección de correo electrónico.\nEste código no es necesario para iniciar sesión, pero necesitarás proporcionarlo antes de activar cualquier función basada en correo electrónico en el wiki.\";'),('es','messages:confirmemail_sendfailed','s:143:\"No fue posible enviar el correo de confirmación. Por favor, comprueba la validez de la dirección de correo.\n\nEl servidor indicó el error: $1\";'),('es','messages:confirmemail_invalid','s:68:\"Código de confirmación incorrecto. El código debe haber expirado.\";'),('es','messages:confirmemail_needlogin','s:55:\"Necesitas $1 para confirmar tu dirección electrónica.\";'),('es','messages:confirmemail_success','s:115:\"Su dirección de correo ha sido confirmada\nAhora puedes [[Special:UserLogin|identificarte]] y colaborar en el wiki.\";'),('es','messages:confirmemail_loggedin','s:56:\"Tu dirección de correo electrónico ha sido confirmada.\";'),('es','messages:confirmemail_subject','s:56:\"confirmación de la dirección de correo de {{SITENAME}}\";'),('es','messages:confirmemail_body','s:418:\"Alguien, probablemente usted mismo, ha registrado desde la dirección IP $1 la cuenta \"$2\" en {{SITENAME}}, utilizando esta dirección de correo.\n\nPara confirmar que esta cuenta realmente le pertenece y activar el correo en {{SITENAME}}, siga este enlace:\n\n$3\n\nSi la cuenta *no* es suya, siga este otro enlace para cancelar la confirmación de la dirección de correo:\n\n$5\n\nEl código de confirmación expirará en $4.\";'),('es','messages:confirmemail_body_changed','s:461:\"A